													dataProperties.push({id:"07319211-5100-4cdf-b501-6d49ceefe406", key:decodeURL("difi%3Adescription_no"), value:decodeURL("DESCRIPTION%3A%0D%0ASemantic+interoperability+enables+organisations+to+process+information+from+external+sources+in+a+meaningful+manner.+It+ensures+that+the+precise+meaning+of+exchanged+information+is+understood+and+preserved+throughout+exchanges+between+parties.+In+the+context+of+the+EIF%2C+semantic+interoperability+encompasses+the+following+aspects%3A%0D%0A%E2%80%A2%09Semantic+interoperability+is+about+the+meaning+of+data+elements+and+the+relationship+between+them.+It+includes+developing+vocabulary+to+describe+data+exchanges%2C+and+ensures+that+data+elements+are+understood+in+the+same+way+by+communicating+parties.%0D%0A%E2%80%A2%09Syntactic+interoperability+is+about+describing+the+exact+format+of+the+information+to+be+exchanged+in+terms+of+grammar%2C+format+and+schemas.%0D%0ASemantic+interoperability+specifications+support+semantic+interoperability+by+addressing+the+core+semantic+interoperability+background+for+solutions.%0D%0A%0D%0ASource%3A+How+does+the+EIRA%C2%A9+support+interoperability%3F%0D%0Ahttps%3A%2F%2Fjoinup.ec.europa.eu%2Fsites%2Fdefault%2Ffiles%2Fhow_does_eira_support_interoperability_v1_0_0.pdf%0D%0A%0D%0AINTEROPERABILITY+SALIENCY%3A%0D%0AThe+Semantic+Interoperability+Specification+ABB+is+salient+for+semantic+interoperability+because+it+enables+organisations+to+process+information+from+external+sources+in+a+meaningful+manner+and+ensuring+that+the+precise+meaning+of+exchanged+information+is+understood+and+preserved+throughout+exchanges+between+parties+as+stated+in+the+EIF+recommendation+n%C2%B032%3A+%22Support+the+establishment+of+sector-specific+and+cross-sectoral+communities+that+aim+to+create+open+information+specifications+and+encourage+relevant+communities+to+share+their+results+on+national+and+European+platforms.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0AThe+following+implementation+is+an+example+on+how+this+specific+Architecture+Building+Block+%28ABB%29+can+be+instantiated+as+a+Solution+Building+Block+%28SBB%29%3A+%0D%0A%0D%0AUnited+Nations+Centre+for+Trade+Facilitation+and+E-Business+%28UN%2FCEFACT%29+standard+-+International+Plant+Protection+Convention+%28IPPC%29+SPSCertificate%0D%0ASpecification+of+phytosanitary+certificates.+These+certificates+are+issued+to+indicate+that+consignments+of+plants%2C+plant+products+or+other+regulated+articles+meet+specified+phytosanitary+import+requirements+and+are+in+conformity+with+the+certifying+statement+of+the+appropriate+model+certificate.%0D%0Ahttps%3A%2F%2Fwww.ippc.int%2Fen%2Fephyto%2Fephyto-technical-information%2F%0D%0A")});

													dataProperties.push({id:"3a8d0cad-5241-4a9a-82d8-2763094f7a0a", key:decodeURL("difi%3Adescription_no"), value:decodeURL("DESCRIPTION%3A%0D%0AShares+the+functionality+of+making+data+available+for+common+use.%0D%0A%0D%0ABased+on+DAMA%0D%0Ahttp%3A%2F%2Fwww.dama.org%2F+++%0D%0A%0D%0AINTEROPERABILITY+SALIENCY%3A%0D%0AThe+Data+Pubblication+Service+ABB+%C2%A0is+salient+for+technical+interoperability+because+it+provides+the+functionalities+to+make+public+data+freely+available+for+use+and+reuse+by+others+unless+restriction+aoply+as+stated+in+the+EIF+recommendation+n.2%3A+%22Publish+the+data+you+own+as+open+data+unless+certain+restrictions+apply.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0AThe+following+implementation+is+an+example+on+how+this+specific+Architecture+Building+Block+%28ABB%29+can+be+instantiated+as+a+Solution+Building+Block+%28SBB%29%3A%0D%0AEuropean+Data+Portal+%0D%0AThe+European+Data+Portal+harvests+the+metadata+of+Public+Sector+Information+available+on+public+data+portals+across+European+countries.+Information+regarding+the+provision+of+data+and+the+benefits+of+re-using+data+is+also+included.%0D%0AWhat+is+Open+Data%3F%0D%0A-%09Open+%28Government%29+Data+refers+to+the+information+collected%2C+produced+or+paid+for+by+the+public+bodies+%28also+referred+to+as+Public+Sector+Information%29+and+made+freely+available+for+re-use+for+any+purpose.+The+licence+will+specify+the+terms+of+use.+%0D%0A-%09Public+sector+information+is+information+held+by+the+public+sector.+The+Directive+on+the+re-use+of+public+sector+information+provides+a+common+legal+framework+for+a+European+market+for+government-held+data.+It+is+built+around+the+key+pillars+of+the+internal+market%3A+free+flow+of+data%2C+transparency+and+fair+competition.+It+is+important+to+note+that+not+all+of+the+public+sector+information+is+Open+Data.%0D%0AWithin+the+Portal%2C+sections+are+dedicated+to%3A%0D%0A-%09Searching+datasets%3A+Categories+have+been+established+to+structure+the+metadata+harvested+from+the+various+countries.+These+categories+follow+the+revision+of+the+DCAT+Application+Profile+and+have+been+mapped+against+the+Eurovoc+Thesaurus.%0D%0A-%09Providing+Data%3A+This+section+gives+an+insight+into+understanding+Open+Data+from+the+perspective+of+a+data+provider.+In+addition%2C+instructions+are+offered+for+those+who+wish+their+data+portal+to+be+harvested+by+the+European+Data+Portal.%0D%0A-%09Using+Data%3A+How+Open+Data+is+being+used%2C+as+well+as+the+economic+benefits+of+Open+Data+are+detailed+in+this+section.%0D%0A-%09Training+and+Library%3A+eLearning+modules+about+Open+Data+as+well+as+training+guides+and+a+knowledge+base+referencing+publications+around+Open+Data+and+featured+projects.%0D%0APortals+can+be+national%2C+regional%2C+local+or+domain+specific.+They+cover+the+28+EU+Member+States%2C+EEA%2C+countries+involved+in+the+EU%27s+neighbourhood+policy+and+Switzerland.%0D%0Ahttps%3A%2F%2Fwww.europeandataportal.eu%2F+++%0D%0A%0D%0ABelgian+Data+Portal%0D%0AThe+Belgian+Data+Portal+provides+data+%28more+than+6500+datasets%29%2C+tools+and+resources.%0D%0AOpen+Data+is+a+driver+for+innovation%2C+economic+growth%2C+transparency+and+participation.+According+to+a+European+study+%28ref.COM+%282011%29+882%29+the+cumulative+economic+benefits+arising+from+the+provision+of+public+data+would+amount+to+%E2%82%AC+40+billion+per+year+in+the+EU.+These+data+lend+themselves+to+reuse+in+the+context+of+new+products+and+services+and+can+improve+the+efficiency+of+public+authorities.+Making+public+sector+data+accessible+makes+it+possible+to+involve+citizens+more+in+political+and+social+life+and+to+make+an+active+contribution+to+policy+areas+such+as+the+environment%2C+mobility%2C+the+economy%2C+and+so+on.%0D%0AThe+2014-2018+Belgian+government+agreement+states+that+the+government+will+focus+on+opening+public+sector+data+%28Open+Data+policy%29.+Open+public+data+is+now+the+rule.+Public+services+make+available+to+citizens%2C+researchers%2C+companies+and+public+authorities+the+reuse+of+data+already+available+to+them+in+the+framework+of+their+missions.%0D%0AIt+is+more+specifically+data+that%3A%0D%0A-%09Public+services+have+collected+as+part+of+their+data+collection+missions%3B%0D%0A-%09Do+not+contain+%28more%29+privacy-sensitive+information+that+is+not+protected+by+intellectual+property+rights+held+by+third+parties%3B%0D%0A-%09Are+published+in+a+format+that+is+easy+to+reuse+automatically+%28%22machine+readable+%22%29%3B%0D%0A-%09Can+be+reused+for+commercial+and+non-commercial+purposes.%0D%0AIt+is+not+only+a+matter+of+making+public+service+data+available%2C+but+also+of+building+a+community+environment+around+these+data.+Companies+can+reuse+some+data+and+enrich+it+with+their+own+information+to+market+new+products+and+services.+Citizens+benefit+from+more+transparent+public+authorities+and+public+services+can+help+improve+the+quality+of+existing+public+data+and+services.%0D%0Ahttp%3A%2F%2Fdata.gov.be%2Fen+%0D%0A")});

+and+highly+reliable.+Consensus%2C+group+management%2C+and+presence+protocols+will+be+implemented+by+the+service+so+that+the+applications+do+not+need+to+implement+them+on+their+own.+Application+specific+uses+of+these+will+consist+of+a+mixture+of+specific+components+of+Zoo+Keeper+and+application+specific+conventions.+ZooKeeper+Recipes+shows+how+this+simple+service+can+be+used+to+build+much+more+powerful+abstractions.%0D%0AApache+have+Java+and+C+interfaces+to+Zoo+Keeper+for+the+applications+themselves.+A+variety+of+client+bindings+is+available+for+a+number+of+languages+including+Python%2C+Ruby+and+Go.%0D%0Ahttps%3A%2F%2Fcwiki.apache.org%2Fconfluence%2Fdisplay%2FZOOKEEPER%2FIndex+%0D%0A")});

													dataProperties.push({id:"d7639ba3-4179-49c3-a67e-a6a9c3989a58", key:decodeURL("difi%3Adescription_no"), value:decodeURL("DESCRIPTION%3A%0D%0AShares+the+functionality+of+enabling+the+permanent+or+long-term+storage+of+selected+%28by+an+authority%29+electronic+documents+or+information+for+preservation+purposes+like+their+enduring+research+value+and+memory+aid.+%0A%0AThe+EIRA%28c%29+differentiates+between+document+management%2C+record+management+and+e-archiving+as+follows%3A%0A-+Document+management+is+primarily+about+day-to-day+use+of+electronic+documents+%28create%2Fupdate%2Fdelete%2Fversioning%29+within+the+operational+environment%3B%0A-+Record+management+is+primarily+about+ensuring+that+information+%28e.g.+in+form+of+an+electronic+document+or+database+record%29+is+available+for+business+and+legal+purposes+%28e.g.+to+proof+and+track+the+handling+of+contracts%29.+If+an+electronic+document+or+information+is+becoming+a+record+%28an+authority+declares+it+as+a+record%29+that+electronic+document+or+information+needs+to+be+handled+by+the+record+management+service+%28based+on+specific+business+or+legal+reasons+%28e.g.+contract+negotiation%29%29.%0A-+e-Archiving+is+primarily+about+storing+records+which+have+been+selected+%28by+an+authority%29+for+permanent+or+long-term+preservation+due+to+their+enduring+research+value+and+as+a+memory+aid.+An+electronic+document+or+information+which+a%29+is+managed+by+the+document+management+service+or+the+record+management+service+and+b%29+is+no+longer+needed+for+business+or+legal+purposes+or+day-to-day+activities%2C+and+c%29+still+has+value+for+research+purposes+or+as+a+memory+aid%2C+the+electronic+document+should+be+managed+by+the+e-archiving+service%E2%80%9D.%0A%0ASource%3A+ISA2+-+EIA+Action%0D%0A%0D%0AINTEROPERABILITY+SALIENCY%3A%0D%0AThe+e-Archiving+Service+ABB+%C2%A0is+salient+for+technical+interoperability+because+it+provides+and+shares+the+functionality+for+the+long-term+or+permanent+preservation+of+records+and+information+in+electronic+form+in+order+to+ensure+their+temporal+egibility%2C+reliability+and+integrity+as+stated+in+the+EIF%3A+%22Legislation+requires+that+decisions+and+data+are+stored+and+can+be+accessed+for+a+specified+time.+This+means+that+records+and+information+in+electronic+form+held+by+public+administrations+for+the+purpose+of+documenting+procedures+and+decisions+must+be+preserved+and+be+converted%2C+where+necessary%2C+to+new+media+when+old+media+become+obsolete.+The+goal+is+to+ensure+that+records+and+other+forms+of+information+keep+their+legibility%2C+reliability+and+integrity+and+can+be+accessed+as+long+as+needed+subject+to+security+and+privacy+provisions.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0A%0D%0ACEF+eArchiving%0D%0AeArchiving+provides+the+core+specifications%2C+software%2C+training+and+knowledge+to+tackle+the+challenge+of+short%2C+medium+and+long-term+data+management+and+reuse+in+a+sustainable%2C+authentic%2C+cost-efficient%2C+manageable+and+interoperable+way.%0D%0Ahttps%3A%2F%2Fec.europa.eu%2Fcefdigital%2Fwiki%2Fdisplay%2FCEFDIGITAL%2FeArchiving%0A")});

													dataProperties.push({id:"1cc31656-061b-4d80-9c4b-792214b09416", key:decodeURL("difi%3Adescription_no"), value:decodeURL("DESCRIPTION%3A%0D%0AReference+Data+is+any+data+used+to+organise+or+categorise+other+data%2C+or+for+relating+data+to+information+both+within+and+beyond+the+boundaries+of+the+enterprise.+Usually+consists+of+codes+and+descriptions+or+definitions.%0D%0A%0D%0ASource%3A+DAMA+DM_BOK%0D%0Ahttp%3A%2F%2Fwww.dama.org%0D%0A%0D%0AReference+data+consists+typically+of+a+small%2C+discrete+set+of+values+that+are+not+updated+as+part+of+business+transactions+but+are+usually+used+to+impose+consistent+classi%EF%AC%81cation.+Reference+data+normally+has+a+low+update+frequency.+Reference+data+is+relevant+across+more+than+one+business+systems+belonging+to+different+organisations+and+sectors+%0D%0A%5BSource%3A+J.+Jordan+%26+C.+Ellen+%282009%29.+Business+need%2C+data+and+business+intelligence%5D.%0D%0A%0D%0AINTEROPERABILITY+SALIENCY%3A%0D%0AThe+Reference+Data+ABB+is+salient+for+semantic+interoperability+because+it+can+be+shared+and+reused+%28e.g.+in+the+form+of+taxonomies+or+controlled+vocabularies%29+between+organisation+to+agree+on+some++basic+information.+Management+of+reference+data+is+a+priority+as+suggested+by+EIF%27s+recommendation+31%3A+%22Put+in+place+an+information+management+strategy+at+the+highest+possible+level+to+avoid+fragmentation+and+duplication.+Management+of+metadata%2C+master+data+and+reference+data+should+be+prioritised.%22%0D%0A%0D%0AEXAMPLES%3A%0D%0AThe+following+implementation+is+an+example+on+how+this+specific+Architecture+Building+Block+%28ABB%29+can+be+instantiated+as+a+Solution+Building+Block+%28SBB%29%3A+%0D%0A%0D%0AEUROSTAT+-+Nomenclature+of+Territorial+Units+for+Statistics+%28NUTS%29+%0D%0APrinciple+1%3A+Population+thresholds%0D%0AThe+NUTS+regulation+defines+minimum+and+maximum+population+thresholds+for+the+size+of+the+NUTS+regions%3A%0D%0A%0D%0ALevel++++++++Minimum++++++++Maximum%0D%0ANUTS+1++++++++3+000+000++++++++7+000+000%0D%0ANUTS+2++++++++800+000++++++++3+000+000%0D%0ANUTS+3++++++++150+000++++++++150+000%0D%0A%0D%0AFor+administrative+levels+of+NUTS%2C+it+is+sufficient+if+the+average+size+of+the+corresponding+regions+lies+within+the+thresholds%3B+in+case+of+non-administrative+levels%2C+each+individual+region+should+do+so.+Exceptions+exist+however+in+case+of+geographical%2C+socio-economic%2C+historical%2C+cultural+or+environmental+circumstances.%0D%0ADespite+the+aim+of+ensuring+that+regions+of+comparable+size+all+appear+at+the+same+NUTS+level%2C+each+level+still+contains+regions+which+differ+greatly+in+terms+of+population.%0D%0APrinciple+2%3A+NUTS+favours+administrative+divisions%0D%0AFor+practical+reasons+the+NUTS+classification+generally+mirrors+the+territorial+administrative+division+of+the+Member+States.+This+supports+the+availability+of+data+and+the+implementation+capacity+of+policy.%0D%0APrinciple+3%3A+Regular+and+extraordinary+amendments%0D%0AThe+NUTS+classification+can+be+amended%2C+but+generally+not+more+frequently+than+every+three+years.+The+amendments+are+usually+based+on+changes+of+the+territorial+structure+in+one+or+more+Member+States.%0D%0AIn+case+of+a+substantial+reorganisation+of+the+administrative+structure+of+a+Member+State%2C+amendments+to+the+NUTS+may+be+adopted+at+intervals+of+less+than+three+years.+This+has+only+happened+once+so+far%2C+in+2014+for+Portugal.%0D%0Ahttp%3A%2F%2Fec.europa.eu%2Feurostat%2Fweb%2Fnuts%2Foverview%0D%0Ahttp%3A%2F%2Fec.europa.eu%2Feurostat%2Fweb%2Fnuts%2Fprinciples-and-characteristics+%0D%0A")});

matic+missions+or+consular+posts+abroad%3B%0D%0A%E2%80%A2%09all+foreigners+residing+in+Belgium+who+are+admitted+or+authorized+to+settle+or+reside+in+the+Kingdom%3B%0D%0A%E2%80%A2%09all+foreigners+%28and+their+family+members%29+who+declare+themselves+refugees+or+who+are+seeking+recognition+of+refugee+status.%0D%0A%0D%0AThe+municipalities+%28and+the+Immigration+Office+for+the+last+category+of+the+population%29+are+responsible+for+recording+the+information.+As+a+pillar+of+e-government%2C+the+National+Register+ensures+the+sharing+of+authentic+data+identifying+individuals+between+different+public+services+with+limited+access+to+such+data.+The+Sectorial+Committee+of+the+National+Register+established+within+the+Commission+for+the+Protection+of+Privacy+is+competent+to+authorize+access+to+the+information+of+the+National+Register+or+the+communication+thereof.%0D%0Ahttps%3A%2F%2Fwww.ehealth.fgov.be%2Ffr%2Fehealthplatform+%0D%0A")});
